import axios from "axios";

const ApiRequest = {
  Session: {
    Login: async (params) => {
      const headers = {
        'Accept': 'application/json',
        'Content-Type': 'application/x-www-form-urlencoded',
    }

    let res = null;
    try {
        res = await axios.post('https://dev.perseo.tv/ws/Login.php', params, {
            headers: headers
        })
        console.log(res);
    } catch (e) {
        console.log(e);
    } finally {
        console.log(res);
    }
    }
  }
}

export default ApiRequest;
